      </div>
      <style jsx global>{`
        body {
          background-color: #203b4f;
        }
        .content {
          text-align: center;
          margin-left: 300px;
          margin-right: auto;
          padding: 14px;
          color: #f5f5f5;
        }
        `}
      </style>
    </div>
  );
}
